import React from "react";
import {CloseOutlined} from "@ant-design/icons";
import TextField from '@material-ui/core/TextField';
import SaveIcon from '@material-ui/icons/Save';
import Button from '@material-ui/core/Button';

export default ({changeToFalse}) =>{
    return(
            <div style={{display:'flex',borderStyle:'dotted',
                marginRight:"74vw",marginTop:'10px',paddingLeft:'10px',marginLeft:'1px'}}>
                <div style={{borderTop:"1px solid lightgrey", fontSize:20}}>
                    <TextField id="standard-basic" label="Enter Name" />
                    <TextField id="standard-basic" label="Enter Aadhaar No" />
                    <TextField id="standard-basic" label="Enter Pan No" />
                    <Button
                        variant="contained"
                        color="primary"
                        size="small"
                        startIcon={<SaveIcon />}
                    >
                        Save
                    </Button>
                </div>
                <div style={{cursor:"pointer",marginLeft:190}}>
                    <CloseOutlined style={{fontSize:'30px'}} onClick={() => changeToFalse()}/>

                </div>

           </div>

    );
};
